import './App.css';

function App() {

  const onSave = () => {
    alert('등록되었습니다!');
  }

  return (
    <div className="app">
      <div className="container">
        <input type="text" placeholder="영어"/>
        <input type="text" placeholder="한글"/>
        <button onClick={onSave}>등록</button>
        <button>시험보기</button>
      </div>
    </div>
  );
}

export default App;
